import React, { Component} from 'react';
import {MapTo} from '@adobe/aem-react-editable-components';

export const CustomEditConfig = {
       emptyLabel: 'Contact Details',
       isEmpty: function(props) {
          return !props || !props.name || !props.email || !props.description;
       }
};

export default class Contact extends Component {
    render() {
           if(CustomEditConfig.isEmpty(this.props)){
                return null;
           }
           return(
                <div>
                    <h4>{this.props.name}</h4>
                    <h3>{this.props.email}</h3>
                    <h3>{this.props.description}</h3>
                </div>
           );
    }
}

MapTo('spa-react/components/contact')(Contact,CustomEditConfig);
